import React,{useEffect} from 'react';

const newComp = (props) => {
    useEffect(()=>{
        console.log(props.newcomp.Lo)
    })
    return (
        <div>
            <span>{props.newcomp.Name}</span>
            <p>{props.newcomp.Title}</p>
            <p>{props.newcomp.Info}</p>
        </div>
    );
};

export default newComp;
